import React from 'react';
import { BrowserRouter, Routes, Route, Link} from 'react-router-dom';
import EventList from './components/EventList';
import EventDetail from './components/EventDetail';
import BookingForm from './components/BookingForm';
import LoginPage from './pages/LoginPage';
import UserDashboard from './pages/Dashbord';
import PrivateRoute from './utils/PrivateRoute';
import { AuthProvider } from './context/AuthContext';
import Navbar from './components/Navbar';
import RegisterPage from './pages/RegisterPage';

function App() { 
  return (
    <BrowserRouter>
      <div>
        <h1>Event Booking App</h1>
        <ul>
          <li><Link to="/">Event List</Link></li>
          <li><Link to="/event-detail">Event Detail</Link></li>
          <li><Link to="/booking-form">Booking Form</Link></li>
          <li><Link to="/login">Login</Link></li>
          <li><Link to="/dashboard">User Dashboard</Link></li>
        </ul>

        <Routes>
          <Route path="/login" element={<LoginPage />} />
          <Route path="/" exact element={<EventList />} />
          <Route path="/events/:eventId" element={<EventDetail />} />
          <Route path="/booking-form" element={<BookingForm />} />
          <Route path="/dashboard" element={<UserDashboard/>} />
          <AuthProvider>
            < Navbar/>
            <PrivateRoute component={UserDashboard} path="/dashboard" exact />
            <Route component={LoginPage} path="/login" />
            <Route component={RegisterPage} path="/register" exact />
        </AuthProvider>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
